· Ağ, kripto ve toplu gönderim türünü seçin. Adresinizde ağ ücretini ödemek için yeterli bakiye bulunduğundan emin olun.
· Gönderici ve alıcı adresleri girin. Dosyaları toplu olarak seçebilir, yapıştırabilir veya içe aktarabilirsiniz. {btn} 
· İşlemi dilediğiniz zaman iptal edebilirsiniz.
